// -------------------------------- Function --------------------------------

// 序号 转 干支
function id2HSEB(id) {
    id = (id == 0)? 60 : id;

    var hs = id % 10;
    hs = (hs == 0)? 10 : hs;

    var eb = id % 12;
    eb = (eb == 0)? 12 : eb;

    return {"hs":hs, "eb":eb}
}

// 时间转换
function time2HSEB(time_str) {
    var temp_date = new Date(time_str);
    var year = temp_date.getFullYear();

    // 判断 干支年
    if(temp_date < new Date(Solar_Terms[year][0])) {
        year = year - 1;
    }
    console.log("\nSexagenary Cycle Calendar:", year);

    // 获取 年干支
    var id_year = (year - start_date.getFullYear() + start_HSEB["Yid"]) % 60;
    var HSEB_year_dict = id2HSEB(id_year);

    console.log("\nHSBE Y:", HSEB_year_dict);
    
    // 获取 月干支
    var id_month = 0;
    var id_ST = 0;
    for (var i=0; i<24; i++){
        if (temp_date < new Date(Solar_Terms[year][i])) {
            id_ST = i - 1;
            id_month = Math.ceil(i/2);
            break;
        }
    }
    id_month = (id_month - 1 + (year - start_date.getFullYear()) * 12 + start_HSEB["Mid"] ) % 60;   //丙寅 序号为3
    var HSEB_month_dict = id2HSEB(id_month);
    console.log("HSBE M:", HSEB_month_dict);

    // 获取 日干支
    var day_start = new Date("1924-2-5 8:00:00");   // Date.parse("1970-1-1 08:00:00") == 0
    var day_temp = new Date(temp_date.toLocaleDateString().concat(" 8:00:00"));
    var id_day = ((day_temp - day_start) / (1000 * 3600 * 24) + start_HSEB["Did"]) % 60;    // 甲寅 序号为51
    var HSEB_day_dict = id2HSEB(id_day);
    console.log("HSBE D:", HSEB_day_dict);

    // 获取 时干支
    var id_hour = ((temp_date - new Date("1924-2-5 9:00:00")) / (1000 * 3600 * 2) + start_HSEB["Hid"]) % 60;
    id_hour = Math.floor(id_hour);
    var HSEB_hour_dict = id2HSEB(id_hour);
    console.log("HSBE H:", HSEB_hour_dict);

    // 合并
    var HSEB_dict = {
        "Yhs": HSEB_year_dict["hs"], "Yeb": HSEB_year_dict["eb"],
        "Mhs": HSEB_month_dict["hs"], "Meb": HSEB_month_dict["eb"],
        "Dhs": HSEB_day_dict["hs"], "Deb": HSEB_day_dict["eb"],
        "Hhs": HSEB_hour_dict["hs"], "Heb": HSEB_hour_dict["eb"],
        "id_ST": id_ST,
        "id_day": id_day, "id_hour": id_hour
    };
    // console.log("\nDate.parse(\"1970-1-1 08:00:00\") = ", Date.parse("1970-1-1 08:00:00"))
    // console.log("\nTime info:", HSEB_dict["id_day"], HSEB_dict["id_hour"]);
    return HSEB_dict;
}

